css:
.github-Project {
  display: flex;
  align-items: center;
  padding: 5px 10px;
  border-bottom: 1px solid rgba(0, 0, 0, 0.5);
}
.github-Project-path {
  flex: 1;
  margin-left: 10px;
}
.github-Project-avatarBtn {
  height: 23px;
  width: 23px;
  padding: 0;
  border-radius: 2px;
  background-color: #292c2f;
  border: none;
}
.github-Project-avatar {
  width: 23px;
  height: 23px;
  border-radius: 2px;
  color: transparent;
  overflow: hidden;
}
.github-Project-lock.btn {
  width: 40px;
  height: 20px;
  padding: 0;
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: baseline;
  border: none;
  background-color: transparent;
  background-image: none;
}
.github-Project-lock.btn:active,
.github-Project-lock.btn:hover {
  background-color: transparent;
  background-image: none;
}
.github-Project .icon {
  padding: 0;
  margin: 0;
  line-height: 1em;
  fill: #aaa;
}
.github-Project .icon:hover {
  fill: #fff;
}
.github-Project .icon.icon-unlock {
  width: 21px;
  height: 17px;
  padding-left: 1px;
}
